import React from "react";
import '../App.css';
import ElementPrerequis from "./elementPrerequis";
function Prerequis(){
    const technologies=[
        {id:"html",nom:"HTML",image:"/img/html.png"},
        {id:"css",nom:"CSS",image:"/img/css-3-logo.png"},
        {id:"javascript",nom:"JAVASCRIPT",image:"CCJavaScript.png"},
    ]
        return(
            <ul>
                {
                    technologies.map((technologie)=>(
                        <ElementPrerequis key={technologie.id}  id={technologie.id} nom={technologie.nom} image={technologie.image} />
                    )
                    )
                }
            </ul>
        )
}
export default Prerequis;
